INSERT INTO `templates` (`id`, `name`, `content`, `created_at`, `updated_at`) VALUES
(1, 'New Leads entry', '<h2><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; New Leads Entry</strong></h2>\r\n\r\n<p>A new Leads entry..</p>\r\n', '0000-00-00 00:00:00', '2014-08-08 20:04:56'),
(2, 'Bienvenido a su Dealer Amigo', '<table border="0" cellpadding="0" cellspacing="0" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table border="0" cellpadding="0" cellspacing="0" style="width:640px">\r\n				<tbody>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<table border="0" cellpadding="0" cellspacing="0" style="width:640px">\r\n							<tbody>\r\n								<tr>\r\n									<td>&nbsp;</td>\r\n									<td>\r\n									<p><strong>Sudealeramigo.com</strong></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<table border="0" cellpadding="0" cellspacing="0" style="width:640px">\r\n							<tbody>\r\n								<tr>\r\n									<td>&nbsp;</td>\r\n									<td>\r\n									<table border="0" cellpadding="0" cellspacing="0" style="height:1093px; width:631px">\r\n										<tbody>\r\n											<tr>\r\n												<td>\r\n												<p>Welcome to C&amp;G Imports Sudealeramigo</p>\r\n\r\n												<p>Gracias por considerar a C&amp;G Imports como opcion para la compra de tu proximo vehiculo Sabemos que hay muchas opciones , pero queremos agradecerte por consideranos entre una de ellas .</p>\r\n\r\n												<p>Al mismo tiempo, queremos recomendarte que tomes en cuenta algunos factores muy importantes antes de hacer una compra tan importante, tales como:</p>\r\n\r\n												<ul>\r\n													<li>Precio *</li>\r\n													<li>Garant&iacute;a *</li>\r\n													<li>Calidad *</li>\r\n													<li>% Intereses y Cargos de Financiamiento</li>\r\n													<li>Confianza de Credibilidad *</li>\r\n												</ul>\r\n\r\n												<p>C&amp;G Imports Sudealeramigo lleva m&aacute;s de 25 anos sirviendo a la comunidad Latina y es una empresa que est&aacute; bien comprometida con nuestra comunidad, Como muestra de ello, Creamos la Promoci&oacute;n &quot; Pida Un Deseo&quot; donde Intentamos hacer realidad los sue&ntilde;os de muchas personas.</p>\r\n\r\n												<p>Hemos servido a m&aacute;s de 50.000 personas a lo largo y ancho de todo el DMV.</p>\r\n\r\n												<p>Todos nuestros veh&iacute;culos cuentan con Garant&iacute;a incluida, inclusive muchos de nuestros modelos aun cuentan con garant&iacute;a de F&aacute;brica.</p>\r\n\r\n												<p>Solo vendemos autos de Calidad y de las mejores marcas Y modelos m&aacute;s recientes. Todos nuestros veh&iacute;culos llevan el AUTOCHECK HISTORY REPORT.</p>\r\n\r\n												<p>A diferencia de algunos dealers, <strong>C&amp;G Imports No vende autos con problemas de T&iacute;tulos, Danos por Incendio, Reconstruidos &quot;Salvages&quot; , Perdida Total , Problemas de Millaje, Accidente Mayor &quot;Frame&quot;.</strong></p>\r\n\r\n												<p>En C&amp;G Imports usted siempre encontrara los mejores precios de el &aacute;rea, adem&aacute;s que usted solo paga por el valor de precio de veh&iacute;culo, sin ning&uacute;n inter&eacute;s o cargo adicional por costos de Financiamiento. Y lo mejor de todo es que le Reportamos su Cr&eacute;dito a las agencias de Cr&eacute;dito 100% Garantizado.</p>\r\n\r\n												<p><strong>En C&amp;G Imports Trabajamos con usted, ya sea que usted tenga:</strong></p>\r\n\r\n												<p>Buen Cr&eacute;dito<br />\r\n												Mal Cr&eacute;dito<br />\r\n												No cr&eacute;dito<br />\r\n												Tax Id.<br />\r\n												<br />\r\n												Que esperar ahora si ya est&aacute; listo para visitarnos y escoger el modelo que m&aacute;s le guste!</p>\r\n\r\n												<p><strong>Ll&aacute;menos ahora mismo o venga a visitarnos en &eacute;l:</strong><br />\r\n												3400 FAIRFAX DR.<br />\r\n												ARLINGTON VA. 22201</p>\r\n\r\n												<p><strong>Horario:</strong><br />\r\n												Lunes a S&aacute;bado 9AM a 8PM,<br />\r\n												Domingos de 10AMa 5PM<br />\r\n												703-525-7441<br />\r\n												<a href="http://www.sudealeramigo.com" target="_blank">Sudealeramigo.com</a><br />\r\n												<strong>Lo Esperamos,</strong><br />\r\n												Sales Team.</p>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n\r\n									<table border="0" cellpadding="0" cellspacing="0" style="height:91px; width:629px">\r\n										<tbody>\r\n											<tr>\r\n												<td>\r\n												<p><!--<singleline label="Title">Cupon de Descuento</singleline></p>--></p>\r\n												</td>\r\n											</tr>\r\n											<tr>\r\n												<td><!--                                                                <a href="http://www.sudealeramigo.com/promocion-de-temporada/" title="">\r\n                                                                    <img src="http://www.sudealeramigo.com/wp-content/uploads/2013/10/toyota-halloweenl-offer2.jpg" alt="" />\r\n                                                                </a>--></td>\r\n											</tr>\r\n											<tr>\r\n												<td>&nbsp;</td>\r\n											</tr>\r\n											<tr>\r\n												<td>\r\n												<p><strong>Sudealeramigo.com</strong></p>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n									<td>&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2014-08-08 20:58:13', '2014-08-27 03:01:04');
